	private static JFrame setUpJFrame(Backend bkd){
		final JFrame Frame = new JFrame();
		Frame.setDefaultCloseOperation(JFrame.EXIT_ON_CLOSE);
		Frame.setVisible(true);
		Frame.setTitle("MTG Duel Decks");
		Frame.setExtendedState(JFrame.MAXIMIZED_BOTH);
		final MTGComponent MTGComp = new MTGComponent(Frame.getContentPane().getWidth(), Frame.getContentPane().getHeight(), bkd);
		Frame.add(MTGComp);
		Frame.addComponentListener(new ComponentAdapter() {
			@Override
			public void componentResized(ComponentEvent e) {
				MTGComp.setWindowX(Frame.getContentPane().getWidth());
				MTGComp.setWindowY(Frame.getContentPane().getHeight());
			}
		});
		ClickHandler ch = new ClickHandler(MTGComp);
		KeyBoardHandler kb = new KeyBoardHandler(MTGComp);
		Frame.addKeyListener(kb);
		Frame.addMouseListener(ch);
		return Frame;
	}
}

package devops.hw1.core;

import java.awt.event.KeyEvent;
import java.awt.event.KeyListener;
/**
 * Handles Keyboard events for the MTG Duel Decks
 *
 */
public class KeyBoardHandler implements KeyListener {

	private MTGComponent MTGComp;
	private boolean priority = true;

	public KeyBoardHandler(MTGComponent comp) {
		this.MTGComp = comp;
	}
	@Override
	public void keyPressed(KeyEvent e) {
		if (e.getKeyChar() == ' '){
			this.MTGComp.getBackend().passPriority(this.priority);
			this.priority = !this.priority;
			this.MTGComp.repaint();
		}
	}

	@Override
	public void keyReleased(KeyEvent e) {
		// TODO Auto-generated method stub

	}

	@Override
	public void keyTyped(KeyEvent e) {
		// TODO Auto-generated method stub

	}

}

package devops.hw1.core;

/**
 * Represents an object on the stack
 *
 */
public class ItemOnStack {
	private Card c;
	private Card target;
	private Boolean player;
	private Zone targetZone;
	
	/**
	 * Constructs an item on the stack object
	 * @param c card on the stack
	 * @param player player that owns the card (true if first player)
	 */
	ItemOnStack(Card c, Boolean player, Card target, Zone targetZone){
		this.c = c;
		this.player = player;
		this.target = target;
		this.targetZone = targetZone;
	}
	
	/**
	 * Gets the card from the item on stack
	 * @return the card on the stack
	 */
	public Card getCard() {
		return c;
	}
	
	/**
	 * Gets the player that owns the item on stack
	 * @return true if the first player owns it, false otherwise
	 */
	public Boolean getPlayer() {
		return player;
	}
	
	/**
	 * Gets the card that this item on the stack is targeting
	 * @return the card being targeted by this stack item
	 */
	public Card getTarget() {
		return target;
	}
	
	/**
	 * Gets the zone that the targeted card is in
	 * @return the zone occupied by the card that this stack item is targeting
	 */
	public Zone getTargetZone() {
		return targetZone;
	}
}

