package devops.hw1.core;

import java.io.File;
import java.util.ArrayList;
import java.util.regex.PatternSyntaxException;

public class Card {
	private String name;
	private String manaCost;
	private String color;
	private String type;
	private String manaAbility;
	private ArrayList<String> abilities = new ArrayList<String>();
	private int power, toughness;
	private String image;
	private Boolean tapped;
	private Boolean flash;

	/**
	 * Constructs a card object with the given name
	 * @param s name of the card
	 */
	@Deprecated
	public Card(String s){
		this.name = s;
		this.tapped = false;
		this.manaAbility = null;
		this.flash = false;
	}
	
	public Card(String name, String manaCost, String color, String type,
			String manaAbility, ArrayList<String> abilities, int power,
			int toughness, String image, Boolean flash){
		this.name = name;
		if(abilities == null){
			throw new IllegalArgumentException("Error creating card " + name + ": null is not a valid ability list");
		}
		this.abilities = abilities;
		try{
			this.setCost(manaCost);
			this.setColor(color);
			this.setType(type);
			this.addManaAbility(manaAbility);
			this.setPT(power, toughness);
			this.setImage(image);
		} catch (Exception e){
			throw new IllegalArgumentException("Error creating card " + name + ": " + e.getMessage());
		}
		this.tapped = false;
		this.flash = flash;
	}

	//!# add more constructors

	/**
	 * Adds ability to card
	 * TODO: come up with a good way to represent abilities (Mckee)
	 * @param string ability to add following TODO: format
	 */
	public void addAbility(String string) {
		this.abilities.add(string);

	}

	/**
	 *
	 * @return a string of all abilities that card has
	 */
	public String[] getAbilities() {
		return (this.abilities.toArray(new String[0]));
	}

	/**
	 * @return color of card represented by W?U?B?R?G?
	 */
	public String getColor() {
		return this.color;
	}

	/**
	 * Gets the cost of the card expressed as oracle text
	 * without curly braces.
	 * Conforms to regex [0-9]*W*U*B*R*G*
	 */
	public String getCost(){
		return this.manaCost;
	}

	/**
	 * @return path of image to card
	 */
	public String getImage() {
		return this.image;
	}

	/**
	 *
	 * @return the name of the card
	 */
	public String getName(){
		return this.name;
	}

	/**
	 * @return power of card
	 */
	public int getPower() {
		return this.power;
	}

	/**
	 * @return toughness of card
	 */
	public int getToughness() {
		return this.toughness;

	}

	/**
	 * Type and subtype of card
	 * <Type>- <subtype>*
	 * types are seperated by spaces
	 * (example Storm Crow -> "Creature- bird")
	 * @return types of card
	 */
	public String getType() {
		return this.type;

	}

	/**
	 * Sets the color of the card to given card
	 * @param string color of card represented by W?U?B?R?G?
	 */
	public void setColor(String string) {
		String regex = "W?U?B?R?G?";
		if(!string.matches(regex)) {
			throw new PatternSyntaxException("Card " + this.name + ": " + string + " is not a valid color", regex, -1);
		}
		this.color = string;

	}

	/**
	 * Sets the cost of the card expressed as oracle text
	 * without curly braces.
	 * Conforms to regex [0-9]*[WUBRG]*
	 *
	 * Ex: (Storm Crow -> '1U', Emrakul -> '15')
	 * @param s mana cost of card
	 */
	public void setCost(String s){
		String regex = "[0-9]*W*U*B*R*G*";
		if(!s.matches(regex)) {
			throw new PatternSyntaxException("Card " + this.name + ": " + s + " is not a valid mana cost", regex, -1);
		}
		this.manaCost = s;
	}

	/**
	 * sets image path for displaying the card
	 * @param string filepath to image
	 */
	public void setImage(String string) {
		File test = new File(string);
		if(!test.exists()) {
			throw new IllegalArgumentException("Card " + this.name + ": " + string + " is not a valid file name");
		}
		this.image = string;

	}

	/**
	 * sets the power of card (if creature)
	 * @param i power of creature
	 */
	public void setPower(int i) {//!# CHECK IF IS CREATURE
		this.power = i;

	}

	/**
	 * Sets both the power and toughness of card
	 * @param p power of card
	 * @param t toughness of card
	 */
	public void setPT(int p, int t){//!# CHECK IF IS CREATURE
		this.toughness = t;
		this.power = p;
	}

	/**
	 * sets toughness of card
	 * @param i toughness
	 */
	public void setToughness(int i) {//!# CHECK IF IS CREATURE
		this.toughness = i;

	}

	/**
	 * Sets the type of given card defined as
	 * <Type>- <subtype>*
	 * (example Storm Crow -> "Creature- bird")
	 * @param s type of card
	 */
	public void setType(String s) {
		if(s == null){
			throw new IllegalArgumentException("Card " + this.name + ": null is not a valid card type");
		}
		String regex = "(Basic )?[A-Z][a-z]*(\\- [A-Z][a-z]*( [A-Z][a-z]*)*)?";
		if(!s.matches(regex)) {
			throw new PatternSyntaxException("Card " + this.name + ": " + s + " is not a valid card typeline", regex, -1);
		} 
		this.type = s;
	}
	
	/**
	 * Sets whether this card can be cast at instant speed independent of its card typeline
	 * @param flash whether this card can be cast at instant speed
	 */
	public void setFlash(boolean flash) {
		this.flash = flash;
	}

	@Override
	public String toString() {
		return this.name;
	}

	/**
	 * Adds a mana ability to the card
	 * @param manaAbility added mana ability
	 */
	public void addManaAbility(String manaAbility) {
		this.manaAbility = manaAbility;
	}

	/**
	 * Gets the mana ability of the card
	 * @return mana ability
	 */
	public String getManaAbility() {
		return this.manaAbility;
	}

	/**
	 * Determines if a card is tapped
	 * @return true if tapped, false if not
	 */
	public Boolean getTapped() {
		return this.tapped;
	}
	
	/**
	 * Determines whether this card can be cast at instant speed
	 * @return whether this card can be cast at instant speed
	 */
	public Boolean isFlash() {
		return this.flash || this.type.contains("Instant");
	}

	/**
	 * Taps a card
	 * @return true if the card was previously untapped, false otherwise
	 */
	public boolean tap() {
		if (this.tapped)
			return false;

		this.tapped = true;
		return true;
	}

	/**
	 * Untaps a card
	 */
	public void untap() {
		this.tapped = false;
	}
}

package devops.hw1.core;

import java.util.Stack;
import java.util.concurrent.RejectedExecutionException;
import java.util.StringTokenizer;

/**
 * Backend object that handles a lot of game logic and information
 *
 */
public class Backend {
	private Phase phase;
	private Boolean turn;
	private Boolean priority;
	private Boolean passed;
	private Stack<ItemOnStack> stack;
	public static Backend bk;

	public static Backend getInstance(){
		if(bk == null)
			bk = new Backend();

		return bk;
	}

	/**
	 * Constructs a backend object
	 */
	public Backend(){
		this.phase = Phase.FIRST_MAIN1;
		this.turn = true;
		this.priority = true;
		this.passed = false;
		this.stack = new Stack<ItemOnStack>();
	}

	/**
	 * Handles logic for moving a card when it's clicked (prototype code)
	 * @param z the zone the card's being moved from
	 * @param currIndex the index that that card currently occupies in that zone
	 * @param c the card that's being moved from its current zone
	 */
	public static void handleCardClicked(Zone z, int currIndex, Card c) {
		if(currIndex < 0){
			throw new IllegalArgumentException(currIndex + " is not a valid index for card click events.");
		}
		if(c == null){
			throw new IllegalArgumentException("Null is not a valid card for card click events.");
		}
		switch(z) {
		case HAND:
			Zone.BATTLE_FIELD.addCard(c, 0);
			break;
		case HAND1:
			Zone.BATTLE_FIELD1.addCard(c, 0);
			break;
		case BATTLE_FIELD:
			Zone.GRAVEYARD.addCard(c, 0);
			break;
		case BATTLE_FIELD1:
			Zone.GRAVEYARD1.addCard(c, 0);
			break;
		default:
			throw new IllegalArgumentException(z + " zone is not a valid zone for card click events.");
		}
		try{
			z.remove(currIndex);
		} catch (IndexOutOfBoundsException e){
			throw new IndexOutOfBoundsException("Card clicked could not remove card: " + e.getMessage());
		}
	}

	//TODO Implement this (no need for input validation yet)
	/**
	 * Prototype function. Moves a card from its current zone to a new one when its ability is activated
	 * @param c the card whose ability is being activated
	 * @param z the zone the card is leaving
	 * @param i the index the card currently occupies in that zone
	 */
	public static void activateAbility(Card c, Zone z, int i) {
		z.remove(i);

		if(z == Zone.HAND)
			addCard(Zone.BATTLE_FIELD, c);

		if(z == Zone.HAND1)
			addCard(Zone.BATTLE_FIELD1, c);

	}

	/**
	 * temporary fix to different ways to call activate ability
	 * @param c the card whose ability is being activated
	 * @param z the zone the card is leaving
	 * @param i the index the card currently occupies in that zone
	 * @param abInd index of the card's ability
	 * TODO: this is weird
	 */
	public static void activateAbility(Card c, Zone z, int i, int abInd) {
		activateAbility(c, z, i);
	}

	/**
	 * Simply adds the card to the given zone at the end of that zone's list
	 * @param z the zone being added to
	 * @param c the card being added
	 */
	public static void addCard(Zone z, Card c) {
		z.addCard(c, z.getSize());
	}

	/**
	 * Adds the given card to the given zone
	 * @param z Zone to add card to
	 * @param c Card to add
	 * @param i	position of the zone to add card
	 */
	void addCard(Zone z, Card c, int i){
		try {
			z.addCard(c, i);
		} catch (IndexOutOfBoundsException e) {
			throw new IndexOutOfBoundsException("Backend: " + e.getMessage());
		}
	}

	/**
	 * This method will get the contents (in order) of all cards of a given zone
	 * @param zone Zone enum that you want cards from
	 * @return Array of Card's in the given zone
	 */
	Card[] getZoneContents(Zone zone){
		return zone.getCards();
	}


	/**
	 * Removes the card at the given index from the zone
	 * @param z zone to remove card from
	 * @param i index to remove the card
	 */
	void removeCard(Zone z, int i){
		try {
			z.remove(i);
		} catch (IndexOutOfBoundsException e) {
			throw new IndexOutOfBoundsException("Backend: " + e.getMessage());
		}

	}


	/**
	 * Gets the current phase
	 * @return the current phase
	 */
	public Phase getPhase() {
		return this.phase;
	}

	/**
	 * Changes the current phase to the next phase
	 */
	public void changePhase() {
		ManaPool.emptyMana();

		if((this.phase == Phase.CLEANUP1) || (this.phase == Phase.CLEANUP2))
			this.turn = !this.turn;

		this.phase = Phase.values()[(((this.phase.ordinal() + 1) % (Phase.CLEANUP2.ordinal() + 1)))];

		//handle untap-step case
		if((this.phase == Phase.UNTAP1) || (this.phase == Phase.UNTAP2)) {
			for(Card c : Zone.BATTLE_FIELD.getCards()) {
				if(c.getTapped()) {
					c.untap();
				}
			}
			for(Card c : Zone.BATTLE_FIELD1.getCards()) {
				if(c.getTapped()) {
					c.untap();
				}
			}
			this.phase = Phase.values()[(((this.phase.ordinal() + 1) % (Phase.CLEANUP2.ordinal() + 1)))];
		}


	}

	/**
	 * Returns the current player whose turn it is
	 * @return true if it is the first player's turn, false if it is the second player's
	 */
	public Boolean getTurn() {
		return this.turn;
	}

	/**
	 * Returns the current player who had priority
	 * @return true if it is the first player's priority, false if it is the second player's
	 */
	public boolean getPriority() {
		return this.priority;
	}

	/**
	 * Passes priority for players
	 * @param player which player is trying to pass priority
	 */
	public void passPriority(boolean player) {
		if(this.priority == player) {

			if (this.passed && !this.stack.empty()) {
				ItemOnStack item = this.stack.pop();
				if(item.getTarget() != null) {
					Card[] tZone = item.getTargetZone().getCards();
					for(int i = 0; i < tZone.length; i++) {
						if(tZone[i].equals(item.getTarget())) {
							item.getTargetZone().remove(i);
						}
					}
				} else {
					if(item.getPlayer()){
						Zone.BATTLE_FIELD.addCard(item.getCard(), 0);
					} else {
						Zone.BATTLE_FIELD1.addCard(item.getCard(), 0);
					}
				}
				this.passed = false;
				this.priority = this.turn;
			} else if(this.passed){
				this.changePhase();
				this.passed = false;
				this.priority= this.turn;
			} else {
				this.passed = true;
				this.priority = !this.priority;
			}
		}
	}

	/**
	 * Activates the mana ability of a card
	 * @param c card with the mana ability
	 * @param player player who activated the mana ability
	 */
	public void activateManaAbility(Card c, Boolean player) {
		StringTokenizer strToken = new StringTokenizer(c.getManaAbility(),":");
		if(strToken.nextToken().equals("T")){
			if(c.getTapped()){
				throw new RejectedExecutionException("Mana ability of " + c.getName() + " cannot be activated: cannot pay cost");
			}
			c.tap();
		}
		if(player){
			switch (strToken.nextToken()) {
			case "W":
				ManaPool.WHITE1.add(1);
				break;
			case "U":
				ManaPool.BLUE1.add(1);
				break;
			case "B":
				ManaPool.BLACK1.add(1);
				break;
			case "R":
				ManaPool.RED1.add(1);
				break;
			case "G":
				ManaPool.GREEN1.add(1);
				break;
			case "1":
				ManaPool.COLORLESS1.add(1);
				break;
			}
		} else {
			switch (strToken.nextToken()) {
			case "W":
				ManaPool.WHITE2.add(1);
				break;
			case "U":
				ManaPool.BLUE2.add(1);
				break;
			case "B":
				ManaPool.BLACK2.add(1);
				break;
			case "R":
				ManaPool.RED2.add(1);
				break;
			case "G":
				ManaPool.GREEN2.add(1);
				break;
			case "1":
				ManaPool.COLORLESS2.add(1);
				break;
			}
		}
	}

	/**
	 * Parses a cost string and returns an array of costs
	 * @param s String of cost
	 * @return array of cost amounts in WUBRGC
	 */
	public int[] parseCost(String s){
		int cost[] = new int[6];

		int i = 0;

		while(isInteger(s.substring(i, i+1))){
			i++;
		}

		if(i != 0){
			cost[5] = Integer.parseInt(s.substring(0,i));
		}

		for(int g = i;g < s.length(); g++){
			switch (s.substring(g, g+1)){
			case "W":
				cost[0]++;
				break;
			case "U":
				cost[1]++;
				break;
			case "B":
				cost[2]++;
				break;
			case "R":
				cost[3]++;
				break;
			case "G":
				cost[4]++;
				break;
			}
		}
		return cost;
	}
	/**
	 * Casts a spell, removing mana from the players mana pool accordingly
	 * @param zone the zone the spell is being cast from
	 * @param c the spell being cast
	 * @param index the index the spell is in
	 * @param player the player that owns the spell
	 * @param target the card being targeted
	 * @param targetZone the zone the targeted card is in
	 * @return true if the spell is cast, false if not
	 */
	public boolean castSpell(Zone zone, Card c, int index, Boolean player, Card target, Zone targetZone) {

		if(!c.isFlash() &&
				((this.turn != player) || (!this.stack.isEmpty()) ||
				(this.phase != Phase.FIRST_MAIN1 && this.phase != Phase.SECOND_MAIN1 && 
				this.phase != Phase.FIRST_MAIN2 && this.phase != Phase.SECOND_MAIN2))){
			return false;
		}
		if((target != null) && !canTarget(c, zone, target, targetZone)) {
			return false;
		}
		
		if(c.getCost() == null){
			throw new IllegalArgumentException("Illegal card " + c.getName() + ": card cost is null");
		}
		int[] costs = this.parseCost(c.getCost());


		if((costs[0] <= ManaPool.getPool('w', player).getAmount()) &&
				(costs[1] <= ManaPool.getPool('u', player).getAmount()) &&
				(costs[2] <= ManaPool.getPool('b', player).getAmount()) &&
				(costs[3] <= ManaPool.getPool('r', player).getAmount()) &&
				(costs[4] <= ManaPool.getPool('g', player).getAmount()) &&
				((costs[0] + costs[1] + costs[2] + costs[3] + costs[4] + costs[5])<=
				(ManaPool.getPool('w', player).getAmount() + ManaPool.getPool('u', player).getAmount()
						+ ManaPool.getPool('b', player).getAmount() + ManaPool.getPool('r', player).getAmount()
						+ ManaPool.getPool('g', player).getAmount() + ManaPool.getPool('c', player).getAmount()))){

			ManaPool.getPool('w', player).remove(costs[0]);
			ManaPool.getPool('u', player).remove(costs[1]);
			ManaPool.getPool('b', player).remove(costs[2]);
			ManaPool.getPool('r', player).remove(costs[3]);
			ManaPool.getPool('g', player).remove(costs[4]);

			costs[5] = this.handleGeneric(ManaPool.getPool('c', player), costs[5]);
			costs[5] = this.handleGeneric(ManaPool.getPool('u', player), costs[5]);
			costs[5] = this.handleGeneric(ManaPool.getPool('b', player), costs[5]);
			costs[5] = this.handleGeneric(ManaPool.getPool('w', player), costs[5]);
			costs[5] = this.handleGeneric(ManaPool.getPool('r', player), costs[5]);
			costs[5] = this.handleGeneric(ManaPool.getPool('g', player), costs[5]);

			this.stack.push(new ItemOnStack(c, player, target, targetZone));

			zone.remove(index);
			this.passed = false;
			return true;
		} else {
			return false;
		}

	}


	/**
	 * Handles paying generic costs with mana from a specific mana pool
	 * @param manaPool mana pool to play mana with
	 * @param genericCost amount of generic mana to pay
	 * @return amount of mana left to pay
	 */
	public int handleGeneric(ManaPool manaPool, int genericCost){
		if(genericCost > 0){
			if(manaPool.getAmount() >= genericCost){
				manaPool.remove(genericCost);
				return 0;
			} else {
				int temp = genericCost - manaPool.getAmount();
				manaPool.empty();
				return temp;
			}
		} else if (genericCost == 0){
			return 0;
		} else {
			throw new IllegalArgumentException(genericCost + " is not a valid amount of generic mana cost.");
		}
	}

	/**
	 * Determines if a string is an integer
	 * @param s string to check
	 * @return true if the string is an integer
	 */
	public static boolean isInteger(String s) {
		return s.matches("\\d+");
	}

	/**
	 * Determines if a card can target another card
	 * @param sourceC the card that is doing the targeting
	 * @param sourceZ the zone that the targeting card is from
	 * @param targetC the card that is being targeting
	 * @param targetZ the zone that the targeted card is in
	 * @return whether the source card in the source zone can target the target card in the target zone
	 */
	public static boolean canTarget(Card sourceC, Zone sourceZ, Card targetC, Zone targetZ) {
		boolean h1ToB2 = (sourceZ == Zone.HAND)  && (targetZ == Zone.BATTLE_FIELD1);
		boolean h1ToB1 = (sourceZ == Zone.HAND)  && (targetZ == Zone.BATTLE_FIELD);
		boolean h2ToB1 = (sourceZ == Zone.HAND1)  && (targetZ == Zone.BATTLE_FIELD);
		boolean h2ToB2 = (sourceZ == Zone.HAND1)  && (targetZ == Zone.BATTLE_FIELD1);


		return h1ToB2 || h1ToB1 || h2ToB1 || h2ToB2;
	}
}

package devops.hw1.core;

public abstract class AbstractData<T> implements IData<T> {
	private long id;
	private T value;
	
	/**
	 * Constructor for an AbstractData<T> object
	 * @param id the ID number of the object
	 * @param value the object that stores this object's value
	 */
	public AbstractData(long id, T value) {
		this.id = id;
		this.value = value;
	}

	
	public long getId() {
		return this.id;
	}

	public T getValue() {
		return this.value;
	}

	/**
	 * This method produces a hash code for the object from the value that it stores
	 * @return the object's hash code
	 */
	@Override
	public int hashCode() {
		final int prime = 31;
		int result = 1;
		result = prime * result + (int) (id ^ (id >>> 32));
		result = prime * result + ((value == null) ? 0 : value.hashCode());
		return result;
	}

	/**
	 * This method determines whether this object and another are equivalent
	 * @param obj the other object that this is compared to
	 * @return whether the two objects are equivalent
	 */
	@Override
	public boolean equals(Object obj) {
		if (this == obj)
			return true;
		if (obj == null)
			return false;
		if (getClass() != obj.getClass())
			return false;

		@SuppressWarnings("unchecked")
		AbstractData<T> other = (AbstractData<T>) obj;
		if (id != other.id)
			return false;
		if (value == null) {
			if (other.value != null)
				return false;
		} else if (!value.equals(other.value))
			return false;
		return true;
	}	
	
	public abstract int compareTo(IData<T> o);
}
